import React, { useState } from 'react';
import LandingPage from './components/LandingPage';
import CarLeaseQuiz from './components/CarLeaseQuiz';
import './App.css';


function App() {
  const [currentPage, setCurrentPage] = useState('landing');

  const renderPage = () => {
    switch(currentPage) {
      case 'landing':
        return <LandingPage onStartQuiz={() => setCurrentPage('quiz')} />;
      case 'quiz':
        return <CarLeaseQuiz onComplete={() => setCurrentPage('results')} />;
      case 'results':
        return <div className="min-h-screen flex items-center justify-center">
                 <h1 className="text-2xl">Results page coming soon!</h1>
               </div>;
      default:
        return <LandingPage onStartQuiz={() => setCurrentPage('quiz')} />;
    }
  };

  return (
    <div className="App">
      {renderPage()}
    </div>
  );
}

export default App;
